import PropTypes from 'prop-types';
import Modal from '../../shared/Modal/Modal';
import Input from '../../shared/Input/Input';

const CreateConfigurationModal = props => {
    const {
        onNewConfigurationModalShow,
        onNewConfigurationModalClose,
        onNewConfigurationModalOk,
        onNewConfigurationModalCancel,
        isNewConfigurationModalShow,
    } = props;

    return (
        <Modal
            onNewConfigurationModalShow={onNewConfigurationModalShow}
            onNewConfigurationModalClose={onNewConfigurationModalClose}
            onNewConfigurationModalOk={onNewConfigurationModalOk}
            onNewConfigurationModalCancel={onNewConfigurationModalCancel}
            isNewConfigurationModalShow={isNewConfigurationModalShow}
            className={'mb-32'}
            title={'test'}
            showClose
            showFooter
        >
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

CreateConfigurationModal.propTypes = {};

export default CreateConfigurationModal;
